import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import SellerOrder from "../screens/SellerOrder";
import SellerDashBoard from "../screens/SellerDashBoard";
import SellerAccount from "../screens/SellerAccount";
import { Entypo, MaterialIcons, FontAwesome } from "@expo/vector-icons";

const Tab = createBottomTabNavigator();

export default function SellerTabs() {
  return (
    <Tab.Navigator
      initialRouteName="SellerDashBoard"
      screenOptions={{
        headerShown: false,
        tabBarStyle: {
          backgroundColor: "white",
        },
        tabBarShowLabel: false,
      }}
    >
      <Tab.Screen
        name="SellerDashBoard"
        component={SellerDashBoard}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <Entypo name="home" size={24} color="#003580" />
            ) : (
              <Entypo name="home" size={24} color="black" />
            ),
        }}
      />

      <Tab.Screen
        name="SellerOrder"
        component={SellerOrder}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <MaterialIcons name="assignment" size={24} color="#003580" />
            ) : (
              <MaterialIcons name="assignment" size={24} color="black" />
            ),
        }}
      />
      <Tab.Screen
        name="SellerAccount"
        component={SellerAccount}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <FontAwesome name="user" size={24} color="#003580" />
            ) : (
              <FontAwesome name="user" size={24} color="black" />
            ),
        }}
      />
    </Tab.Navigator>
  );
}
